import React from "react";

const Home = ({ items }) => {
  return (
    <PlaylistItems>
      {items.length > 0 && <h1> {items[0].owner.display_name}'s Playlists </h1>}
      {items.map((item, i) => (
        <PlaylistItem key={v4()}>
          <img src={item.images[0].url} height="100" />
          <PlaylistTitle>
            <Link to={`/playlist/${item.id}`}>{item.name}</Link>
          </PlaylistTitle>
        </PlaylistItem>
      ))}
    </PlaylistItems>
  );
};
export default Home;
